const Input = (props) => (
    <div className="input-wrapper">
        <p>{props.label}</p>
        <input type={props.type} placeholder={props.placeholder} required/>

        <style jsx>{`
        div{
          width: 100vw;
          height: 100vh;
          background-color: #00629b;
          display: flex;
          align-items: center;
          justify-content: center;
        }
        .test{
          margin:20px;
          border: 2px solid red;
        }
		`}</style>
    </div>
)

export default Input;
